package com.dns.taxchina.service.model;/** * @author henzil * @version create time:2014-6-4_下午10:14:09 * @Description 内置视频的model 类. */public class InternalVideoModel extends PVideoModel{	/**	 * 	 */	private static final long serialVersionUID = -490041081097968988L;	private String id;		private String title;		private String videoName;		private String size;	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getVideoName() {		return videoName;	}	public void setVideoName(String videoName) {		this.videoName = videoName;	}	public String getSize() {		return size;	}	public void setSize(String size) {		this.size = size;	}	}